    }
    render() {
        return (
            <Switch style={{ float: 'right' }}>
                <Redirect from="index.html" to="/" />
                <Route exact path="/" component={MainContent} />
                <Route exact path="/Gallery" component={Gallery} />
                <Route exact path="/about" component={About} />
                <Redirect from="*" to="/" />
            </Switch>
        );
    }
}

export default MainContent;
